var oneToManyFlowmapLayer = L.canvasFlowmapLayer(airbaltics, {
originAndDestinationFieldIds: {
           originUniqueIdField: 'S_city_id',
			originGeometry: {
              x: 'Source_x',
              y: 'Source_y'
            },
			destinationUniqueIdField: 'D_city_id',
            destinationGeometry: {
              x: 'Dest_x',
              y: 'Dest_y'
            }
		},
        pathDisplayMode: 'selection',
        animationStarted: true,
		animationEasingFamily: 'Cubic',
          animationEasingType: 'In',
          animationDuration: 2000
        }).addTo(map);
				 
		 oneToManyFlowmapLayer.on('mouseover', function(e) {
			  if (e.sharedOriginFeatures.length) {
			  oneToManyFlowmapLayer.selectFeaturesForPathDisplay(e.sharedOriginFeatures, 'SELECTION_NEW');
          }
		if (e.sharedDestinationFeatures.length) {
            oneToManyFlowmapLayer.selectFeaturesForPathDisplay(e.sharedDestinationFeatures, 'SELECTION_NEW');
          }	
});	
		oneToManyFlowmapLayer.selectFeaturesForPathDisplayById('S_city_id', 3953, true, 'SELECTION_NEW');
		
	var airports = L.geoJson(airbaltics, {
	pointToLayer: function(feature, latlng) {
    return  L.circleMarker(latlng, {radius: 1});
	},
	onEachFeature: function(feature, marker) {
			marker.bindPopup("<center><br><b>"+ " City: "+ feature.properties.Dest_city +", "+feature.properties.Dest_count+". at location: " + marker.getLatLng() + 
	"</b></center>" )}});
	//airports.addTo(map);
	
//---- PART 4: ADDING A LAYER CONTROL

var features = {
	"Flight routes": oneToManyFlowmapLayer,
	"Airports": airports
};

//the legend uses the layer control with entries for the base maps and two of the layers we added
//in case either base maps or features are not used in the layer control, the respective element in the properties is null

var legend = L.control.layers(basemaps,features, {position:'bottomleft', collapsed:true}).addTo(map);
